import React, { useState } from 'react';
import { DragDropContext, Droppable, Draggable } from 'react-beautiful-dnd';

const CategorizedForm = () => {
  const [categories, setCategories] = useState(["Category 1", "Category 2"]);
  const [options, setOptions] = useState(["Option 1", "Option 2"]);
  const [categoryItems, setCategoryItems] = useState({
    "Category 1": [],
    "Category 2": [],
  });

  const handleDragEnd = (result) => {
    const { source, destination } = result;

    // Do nothing if dropped outside any destination
    if (!destination) return;

    // Moving within the same droppable
    if (source.droppableId === destination.droppableId) {
      const items = Array.from(categoryItems[source.droppableId]);
      const [moved] = items.splice(source.index, 1);
      items.splice(destination.index, 0, moved);

      setCategoryItems({
        ...categoryItems,
        [source.droppableId]: items,
      });
    } else {
      // Moving between categories or from options
      const sourceItems =
        source.droppableId === "options"
          ? Array.from(options)
          : Array.from(categoryItems[source.droppableId]);
      const destinationItems =
        destination.droppableId === "options"
          ? Array.from(options)
          : Array.from(categoryItems[destination.droppableId]);

      const [moved] = sourceItems.splice(source.index, 1);
      destinationItems.splice(destination.index, 0, moved);

      if (source.droppableId === "options") {
        setOptions(sourceItems);
      } else {
        setCategoryItems({
          ...categoryItems,
          [source.droppableId]: sourceItems,
        });
      }

      if (destination.droppableId === "options") {
        setOptions(destinationItems);
      } else {
        setCategoryItems({
          ...categoryItems,
          [destination.droppableId]: destinationItems,
        });
      }
    }
  };

  const addCategory = () => {
    const newCategory = `Category ${categories.length + 1}`;
    setCategories([...categories, newCategory]);
    setCategoryItems({ ...categoryItems, [newCategory]: [] });
  };

  const addOption = () => {
    const newOption = `Option ${options.length + 1}`;
    setOptions([...options, newOption]);
  };

  return (
    <div className="p-4 bg-gray-100 rounded-md">
      <h1 className="text-xl font-bold mb-4">Categorized Question Form</h1>

      {/* Add Categories */}
      <button
        onClick={addCategory}
        className="bg-blue-500 text-white px-4 py-2 rounded-md mb-4"
      >
        Add Category
      </button>

      {/* Add Option */}
      <button
        onClick={addOption}
        className="bg-green-500 text-white px-4 py-2 rounded-md mb-4 ml-4"
      >
        Add Option
      </button>

      <DragDropContext onDragEnd={handleDragEnd}>
        <div className="flex space-x-4">
          {/* Options List */}
          <Droppable droppableId="options">
            {(provided) => (
              <div
                ref={provided.innerRef}
                {...provided.droppableProps}
                className="w-1/3 bg-white shadow-md rounded-md p-4"
              >
                <h3 className="text-lg font-semibold mb-2">Options</h3>
                {options.map((option, index) => (
                  <Draggable key={option} draggableId={option} index={index}>
                    {(provided) => (
                      <div
                        ref={provided.innerRef}
                        {...provided.draggableProps}
                        {...provided.dragHandleProps}
                        className="bg-gray-200 rounded-md p-2 mb-2"
                      >
                        {option}
                      </div>
                    )}
                  </Draggable>
                ))}
                {provided.placeholder}
              </div>
            )}
          </Droppable>

          {/* Categories */}
          {categories.map((category) => (
            <Droppable key={category} droppableId={category}>
              {(provided) => (
                <div
                  ref={provided.innerRef}
                  {...provided.droppableProps}
                  className="w-1/3 bg-white shadow-md rounded-md p-4"
                >
                  <h3 className="text-lg font-semibold mb-2">{category}</h3>
                  {categoryItems[category].map((item, index) => (
                    <Draggable key={item} draggableId={item} index={index}>
                      {(provided) => (
                        <div
                          ref={provided.innerRef}
                          {...provided.draggableProps}
                          {...provided.dragHandleProps}
                          className="bg-gray-200 rounded-md p-2 mb-2"
                        >
                          {item}
                        </div>
                      )}
                    </Draggable>
                  ))}
                  {provided.placeholder}
                </div>
              )}
            </Droppable>
          ))}
        </div>
      </DragDropContext>
    </div>
  );
};

export default CategorizedForm;
